import React from "react";
import Grid from '@material-ui/core/Grid';

const Portfolio = ({ data }) => {
  if (data) {
    var projects = data.projects.map(function (projects) {
      var projectImage = "images/portfolio/" + projects.image;
      return (
        <>

        <div  key={projects.title} className="columns portfolio-item">



          <div  style={{display:"flex"}} className="item-wrap">
            <a href={projects.url} title={projects.title}>
              <img  alt={projects.title} src={projectImage}  />
              <div className="overlay">
                <div className="portfolio-item-meta">
                  <h5>{projects.title}</h5>
                  <p>{projects.category}</p>
                </div>
              </div>
              <div className="link-icon">
                <i className="fa fa-link"></i>
              </div>
            </a>
          </div>
          <h5 style={{fontSize:"13px",textAlign:"center"}}>{projects.title}</h5>


        </div>



        </>
      );
    });
  }

  return (
    <section id="portfolio">
      <div className="row">
        <div className="twelve columns collapsed">
         <b> <h1 style={{color:"black",fontSize:"30px",fontWeight:"600"}}>PROJECTS</h1></b>
          <p style={{textAlign:"center"}}>Check Out Some of My Works.</p>

      <div>
            {projects}
          </div>


        </div>
      </div>
    </section>
  );
};

export default Portfolio;
